import React, { Component } from 'react';

class DetailsForm extends Component {

    render() {
        return (
                <div className="modal-body mx-4">
                    <div className="form-group">
                        <input type="text" className="form-control" placeholder="04/09/1900" />
                    </div>
                    <div className="form-group">
                        <input type="email" className="form-control" placeholder="08/01/2020" />
                    </div>
                    <div className="form-group">
                        <input type="text" className="form-control" placeholder="Company Name" />
                    </div>
                    <button type="button" className="btn btn-info" onClick={()=>this.props.changeCount('prev')}>Previous</button>
                    <button type="submit" className="btn btn-primary" onClick={()=>this.props.changeCount('next')}>Submit</button>
                </div>
        )
    }

}

export default DetailsForm;
